import React from "react";

const WorkshopCadastro = () => {
    return(
        <div className="page">
        <Header title="SAIR"/>
        <div className="content">
          <Title text="MEUS WORKSHOPS" fontSize="3.5rem" />
        </div>
        </div>
    );
};

export default WorkshopCadastro;
